import React from 'react'
import './MensageItem.css';

function MensageItem() {
  return (
    <div className='messageLine'>
        <div className='messageItem'>
            <div className='messageText'>Bla bla bla</div>
            <div className='messageDate'>19:00</div>
        </div>
    </div>
  )
}

export default MensageItem
